import React from "react";
import ReactDOM from "react-dom/client";

function App() {
  return (
    <div>
      <h1> Hello React !</h1>
      <Pizza />
    </div>
  );
}

function Pizza() {
  return (
    <div>
      <img scr="pizzas/spinaci.jpg" alt="Pizza scpinaci" />
      <h2>Pizza Spinaci</h2>
      <p>Tomato, mozarella, spinach, and ricotta cheese </p>
    </div>
  );
}
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
